import React from 'react';
import Logo from './components/Logo/Logo';
import './style.scss';

function Header(props) {
	return (
		<div className='wrapper'>
			<div>
				<Logo />
			</div>
			<ul>
				<li>
					<a href='#'>About</a>
				</li>
				<li>
					<a href='#'>Projects</a>
				</li>
				<li>
					<a href='#'>Content</a>
				</li>
			</ul>
		</div>
	);
}

export default Header;
